import React, { useRef, useState } from "react";
import { jsPDF } from "jspdf";
import { ArrowDown } from "react-feather";

import Editor from "../Editor/Editor";
import Resume from "../Resume/Resume";

import styles from "./Body.module.css";

function Body() {
  const colors = ["#239ce2", "#48bb78", "#0bc5ea", "#a0aec0", "#ed8936"];
  const sections = {
    basicInfo: "Basic Info",
    workExp: "Work Experience",
    project: "Projects",
    education: "Education",
    achievement: "Achievements",
    summary: "Summary",
    other: "Other",
  };

  const [activeColor, setActiveColor] = useState(colors[0]);
  const [resumeInformation, setResumeInformation] = useState({
    [sections.basicInfo]: {
      id: sections.basicInfo,
      sectionTitle: sections.basicInfo,
      detail: {},
    },
    [sections.workExp]: {
      id: sections.workExp,
      sectionTitle: sections.workExp,
      details: [],
    },
    [sections.project]: {
      id: sections.project,
      sectionTitle: sections.project,
      details: [],
    },
    [sections.education]: {
      id: sections.education,
      sectionTitle: sections.education,
      details: [],
    },
    [sections.achievement]: {
      id: sections.achievement,
      sectionTitle: sections.achievement,
      points: [],
    },
    [sections.summary]: {
      id: sections.summary,
      sectionTitle: sections.summary,
      detail: "",
    },
    [sections.other]: {
      id: sections.other,
      sectionTitle: sections.other,
      detail: "",
    },
  });

  const generatePDF = () => {
    const doc = new jsPDF();
    let y = 10; // Vertical position

    doc.setFont("helvetica", "bold");
    doc.setFontSize(16);
    doc.text("Resume", 105, y, { align: "center" });

    y += 10;
    doc.setFont("helvetica", "normal");
    doc.setFontSize(12);

    Object.keys(resumeInformation).forEach((key) => {
      const section = resumeInformation[key];

      if (section.sectionTitle) {
        doc.setFont("helvetica", "bold");
        doc.text(section.sectionTitle, 10, y);
        y += 7;
      }

      if (section.detail && typeof section.detail === "object") {
        Object.keys(section.detail).forEach((field) => {
          doc.setFont("helvetica", "normal");
          doc.text(`${field}: ${section.detail[field]}`, 15, y);
          y += 6;
        });
      }

      if (Array.isArray(section.details)) {
        section.details.forEach((detail) => {
          doc.setFont("helvetica", "normal");
          doc.text(`• ${detail.title || "Title"} - ${detail.date || "Date"}`, 15, y);
          y += 6;
          if (detail.description) {
            doc.setFontSize(10);
            doc.text(detail.description, 20, y);
            doc.setFontSize(12);
            y += 6;
          }
        });
      }

      if (Array.isArray(section.points)) {
        section.points.forEach((point) => {
          doc.text(`• ${point}`, 15, y);
          y += 6;
        });
      }

      if (typeof section.detail === "string") {
        doc.setFont("helvetica", "normal");
        doc.text(section.detail, 15, y);
        y += 6;
      }

      y += 4;
    });

    doc.save("Resume.pdf");
  };

  return (
    <div className={styles.container}>
      <p className={styles.heading}>Resume Builder</p>
      <div className={styles.toolbar}>
        <div className={styles.colors}>
          {colors.map((item) => (
            <span
              key={item}
              style={{ backgroundColor: item }}
              className={`${styles.color} ${
                activeColor === item ? styles.active : ""
              }`}
              onClick={() => setActiveColor(item)}
            />
          ))}
        </div>
        <button onClick={generatePDF}>
          Download <ArrowDown />
        </button>
      </div>
      <div className={styles.main}>
        <Editor
          sections={sections}
          information={resumeInformation}
          setInformation={setResumeInformation}
        />
        <Resume
          sections={sections}
          information={resumeInformation}
          activeColor={activeColor}
        />
      </div>
    </div>
  );
}

export default Body;
